--
-- Table structure for table `transaction`
--

DROP TABLE IF EXISTS `transaction`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `transaction` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `purchaseinfoid` int(10) NOT NULL,
  `quoteid` int(10) NOT NULL,
  `quantity` varchar(10) CHARACTER SET utf8 NOT NULL,
  `unity` varchar(20) CHARACTER SET utf8 NOT NULL,
  `price` varchar(10) CHARACTER SET utf8 NOT NULL,
  `total` varchar(20) CHARACTER SET utf8 NOT NULL,
  `delivertime` varchar(100) CHARACTER SET utf8 NOT NULL,
  `checktime` varchar(100) CHARACTER SET utf8 NOT NULL,
  `suppliercomment` text CHARACTER SET utf8,
  `purchasecomment` text CHARACTER SET utf8,
  `score_to_supplier` int(10) NOT NULL,
  `score_to_purchase` int(10) NOT NULL,
  `pay` int(10) NOT NULL,
  `payday` int(10) NOT NULL,
  `payinfo` varchar(100) CHARACTER SET utf8 NOT NULL,
  `status` int(10) NOT NULL DEFAULT '1',
  `createtime` varchar(20) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;
